import { SET_SPD_WAVELENGTH } from "../types";

const initialState = {
  spd: [],
  wavelengths: [],
  loading: false
};

export default function(state = initialState, action) {
  switch (action.type) {
    case SET_SPD_WAVELENGTH:
      return {
        ...state,
        spd: action.payload.spd,
        wavelengths: action.payload.wavelengths
      };
    default:
      return state;
  }
}
